    "2016-05-31T01:05:31.535705",nt"name": "afsc-abl-shorezone-ground-stations-web-posted-database-in-arcgis",nt"isopen":
    false,nt"url": null,nt"notes": "The web-posted Alaska Shore Station Database
    is a compilation of hundreds of intertidal sites that were visited and evaluated
    throughout the coastal waters of Alaska. At each station attempts are made to document
    all observed species and their assemblages, geomorphic features, measurements of
    beach length and slope, and gather photographic examples. This online database has
    been designed to integrate with the spatially explicit, Alaska ShoreZone web enabled
    GIS platform. The end result is a user friendly and accessible version of the Shore
    Station database with a queryable display of station locations, downloadable species
    lists and photos.",nt"license_title": null,nt"extras": [{ntt"key":
